import './App.css';
import { useState } from 'react';
import Navbar from './components/Navbar';
import CompetitionTable from './CompetitionTable';
import About from './components/About';

function App() {
  const [activeTab, setActiveTab] = useState('calculator');
  const [gender, setGender] = useState('mens');
  const [season, setSeason] = useState('outdoor');
  const [mode, setMode] = useState('performance');
  const [eventType, setEventType] = useState('100m');
  const [performance, setPerformance] = useState('');
  const [points, setPoints] = useState(null);

  const calculate = async () => {
    try {
      if (mode === 'points') {
        // Performance to Points calculation
        const response = await fetch('http://localhost:5001/api/calculate-points', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify({
            event_type: eventType,
            performance: performance,
            gender: gender,
            season: season
          }),
        });
        const data = await response.json();
        setPoints(Math.round(data.points));
      } else {
        // Points to Performance calculation
        const response = await fetch('http://localhost:5001/api/calculate-performance', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify({
            event_type: eventType,
            points: points,
            gender: gender,
            season: season
          }),
        });
        const data = await response.json();
        setPerformance(data.performance);
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const calculatePerformance = async (points, eventType) => {
    try {
      const response = await fetch('http://localhost:5001/api/calculate-performance', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          event_type: eventType,
          points: points,
          gender: gender,
          season: season
        }),
      });
      const data = await response.json();
      return data.performance;
    } catch (error) {
      console.error('Error:', error);
      return null;
    }
  };

  const renderResults = () => {
    if (!points && !performance) return null;

    return (
      <div className="results">
        <h2>Results</h2>
        <p className="points">
          {mode === 'points' 
            ? `${Math.round(points)} points` 
            : `${performance} ${eventType}`}
        </p>
      </div>
    );
  };

  return (
    <div className="App">
      <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
      <main className="main-content">
        {activeTab === 'calculator' ? (
          <div className="content-container">
            <div className="calculator-wrapper">
              <div className="calculator-form">
                <div className="gender-toggle">
                  <div className="toggle-container">
                    <div 
                      className={`toggle-slider ${gender === 'womens' ? 'right' : 'left'}`}
                    />
                    <div 
                      className={`toggle-option ${gender === 'mens' ? 'active' : ''}`}
                      onClick={() => setGender('mens')}
                    >
                      Men
                    </div>
                    <div 
                      className={`toggle-option ${gender === 'womens' ? 'active' : ''}`}
                      onClick={() => setGender('womens')}
                    >
                      Women
                    </div>
                  </div>
                </div>

                <div className="season-toggle">
                  <div className="toggle-container">
                    <div 
                      className={`toggle-slider ${season === 'indoor' ? 'right' : 'left'}`}
                    />
                    <div 
                      className={`toggle-option ${season === 'outdoor' ? 'active' : ''}`}
                      onClick={() => setSeason('outdoor')}
                    >
                      Outdoor
                    </div>
                    <div 
                      className={`toggle-option ${season === 'indoor' ? 'active' : ''}`}
                      onClick={() => setSeason('indoor')}
                    >
                      Indoor
                    </div>
                  </div>
                </div>

                <div className="mode-toggle">
                  <div className="toggle-container">
                    <div 
                      className={`toggle-slider ${mode === 'points' ? 'right' : 'left'}`}
                    />
                    <div 
                      className={`toggle-option ${mode === 'performance' ? 'active' : ''}`}
                      onClick={() => {
                        setMode('performance');
                        setPoints(null);
                        setPerformance('');
                      }}
                    >
                      Performance
                    </div>
                    <div 
                      className={`toggle-option ${mode === 'points' ? 'active' : ''}`}
                      onClick={() => {
                        setMode('points');
                        setPoints(null);
                        setPerformance('');
                      }}
                    >
                      Points
                    </div>
                  </div>
                </div>

                <div>
                  <label>Event:</label>
                  <select 
                    value={eventType}
                    onChange={(e) => setEventType(e.target.value)}
                  >
                    {/* Track Events */}
                    <option value="100m">100m</option>
                    <option value="200m">200m</option>
                    <option value="400m">400m</option>
                    <option value="800m">800m</option>
                    <option value="1500m">1500m</option>
                    <option value="3000m">3000m</option>
                    <option value="5000m">5000m</option>
                    <option value="10000m">10000m</option>

                    {/* Hurdles */}
                    <option value="100mH">100mH</option>
                    <option value="110mH">110mH</option>
                    <option value="400mH">400mH</option>
                    <option value="3000mSC">3000mSC</option>

                    {/* Jumps */}
                    <option value="HJ">High Jump</option>
                    <option value="PV">Pole Vault</option>
                    <option value="LJ">Long Jump</option>
                    <option value="TJ">Triple Jump</option>

                    {/* Throws */}
                    <option value="SP">Shot Put</option>
                    <option value="DT">Discus</option>
                    <option value="HT">Hammer</option>
                    <option value="JT">Javelin</option>

                    {/* Combined Events */}
                    <option value="Heptathlon">Heptathlon</option>
                    <option value="Decathlon">Decathlon</option>

                    {/* Race Walks */}
                    <option value="5000mW">5000m Walk</option>
                    <option value="10000mW">10000m Walk</option>
                    <option value="20kmW">20km Walk</option>
                    <option value="35kmW">35km Walk</option>
                    <option value="50kmW">50km Walk</option>

                    {/* Road Events */}
                    <option value="10km">10km Road</option>
                    <option value="HM">Half Marathon</option>
                    <option value="Mar">Marathon</option>
                  </select>
                </div>

                <div>
                  <label>{mode === 'points' ? 'Performance:' : 'Points:'}</label>
                  <input
                    type="text"
                    value={mode === 'points' ? performance : points || ''}
                    onChange={(e) => {
                      if (mode === 'points') {
                        setPerformance(e.target.value);
                      } else {
                        setPoints(e.target.value);
                      }
                    }}
                    placeholder={mode === 'points' ? 'Enter performance' : 'Enter points'}
                  />
                </div>

                <button className="calculate-button" onClick={calculate}>
                  Calculate
                </button>

                {renderResults()}
              </div>
            </div>

            <div className="comparison-wrapper">
              <CompetitionTable 
                points={points}
                gender={gender}
                season={season}
              />
            </div>
          </div>
        ) : activeTab === 'competition' ? (
          <div className="world-ranking-section">
            World Ranking Points content here
          </div>
        ) : (
          <About />
        )}
      </main>
    </div>
  );
}

export default App;
